import { Link } from "react-router-dom";
import "./style.css";
import LogoutIcon from "@mui/icons-material/Logout";
import { Button } from "@mui/material";
import { createTheme, ThemeProvider } from "@mui/material/styles";

function Header() {
  const theme = createTheme({
    status: {
      danger: "#e53e3e",
    },
    palette: {
      primary: {
        main: "#b9114b",
        darker: "#053e85",
      },
      neutral: {
        main: "#64748B",
        contrastText: "#fff",
      },
    },
  });

  return (
    <ThemeProvider theme={theme}>
      <header>
        <a href="/">
          <img
            className="imagemLogo"
            src="https://youxgroup.com.br/wp-content/uploads/2021/07/logosite.png"
          />
        </a>
        <div className="menu"></div>

        <div className="menuSuperiorDireito">
          <hr className="vertical"></hr>
          <div className="dados">
            <img
              className="imagemUsuario"
              src="https://e7.pngegg.com/pngimages/96/344/png-clipart-user-profile-instagram-computer-icons-insta-head-silhouette.png"
            ></img>
            <a className="dadosUsuario">Dados do usu√°rio</a>
            <div>
              <Link to="/">Home</Link>
              <Button startIcon={<LogoutIcon />}></Button>
            </div>
          </div>
        </div>
      </header>
    </ThemeProvider>
  );
}

export default Header;
